import React, {Component} from "react"; 
import Project1 from "./images";

class Cards extends Component {
    render(){
        return (
        <div className="Cards">
            <h1>{this.props.title}</h1>
            <p>Image</p>
            <p>{this.props.technology}</p>
            <p>{this.props.description}</p>
        </div>)
    }
}

export default Cards;
